description.p:
    Напишіть програму, яка знайде кількості дільників для усіх підряд
	чисел у проміжку від A до B (обидві межі включно), і виведе:



		суму цих кількостей;



		суму квадратів цих кількостей;



		суму чисел, утворених з окремо взятих цифр цих кількостей.



  Формат результату

Виведіть у одному рядку три числа, розділені пробілами: 
суму кількостей дільників усіх чисел проміжку;
суму квадратів кількостей дільників;
суму чисел, утворених з окремо взятих цифр цих кількостей.
